import {
  Form,
  Select,
  InputNumber,
  DatePicker,
  Switch,
  Slider,
  Button,
} from "antd";
const FormItem = Form.Item;
import {LeftOutlined} from '@ant-design/icons'

function headerCovid() {
  return (
    <FormItem>
      <div className="nu-font-covid">
        <div>
          <div
            style={{
              display: "flex",
              flexDirection: "row",
              width: "100%",
              height: "100%",
            }}
          >
            <div
              style={{
                textAlign: "left",
                display: "flex",
                width: "100%",
                justifyContent: "flex-start",
                alignItems: "center",
              }}
            >
              <Button style={{height:"42px",fontSize:"22px",marginLeft:"20px"}} type="primary"><LeftOutlined />ย้อนกลับ</Button>
            </div>

            <div
              style={{
                textAlign: "left",
                display: "flex",
                width: "100%",
                flexDirection: "column",
                marginRight:"10px"
              }}
            >
              <div
                style={{
                  display: "flex",
                  justifyContent: "center",
                  textAlign: "right",
                  alignItems:"center",
                  flexDirection:"column",
                }}
              >
                <h1 style={{ color: "white",fontSize:"32px" ,background:"red"}}>แบบประเมินโรคไวรัส COVID-19</h1>
                <h2 style={{ color: "white",fontSize:"18px",background:"blue" }}>
                แบบประเมินโรคติดเชื้อไวรัสโคโรนาสายพันธุ์ใหม่ 2019 (COVID-19)
                </h2>
              </div>
            </div>
          </div>
        </div>
      </div>
    </FormItem>
  );
}
export default headerCovid;
